import React from 'react';
import './Card.css';
export default function Card(props){
      return(
          <>
          <div className="card">
              <div className="img">
                 <img src={props.image} alt="" />
              </div>
              <h4>HTML|CSS</h4>
              <div className="text">
               {props.text}
              </div>
          </div>
          </>
      )
}
